import React from "react";

import "./header.css";
import Logo from "../logo";
import NavigationList from "../navigation-list";

export default class Header extends React.Component {
  componentWillReceiveProps() {
    this.forceUpdate();
  }

  render() {
    return (
      <div className="header">
        <Logo />
        <NavigationList />
      </div>
    );
  }
}
